  background-color: orange;
  color: white;
}`;

export default function Example() {
  return (
    <DayPicker
      initialMonth={new Date(2020, 1)}
      selectedDays={[new Date(2020, 1, 1), new Date(2020, 10, 4)]}
    />
  );
}
